import streetphoto from "../images/exterior/restaurant-street.jpeg";

export default function Hero() {
  return (
    <div className="w-96 h-96 relative bg-white">
      <img src="streetphoto" className="w-96 h-96 left-0 top-0 absolute" />
    </div>
  );
}
